class TranslateScreen extends StatefulWidget {
  @override
  _TranslateScreenState createState() => _TranslateScreenState();
}

class _TranslateScreenState extends State<TranslateScreen> {
  String selectedInputLang = 'English';
  String selectedOutputLang = 'Ilocano';
  String inputText = '';
  String translatedText = '';
  bool isLoading = false;
  final FlutterTts flutterTts = FlutterTts();
  bool _isSidebarVisible = false; // Initialize to false to hide the sidebar on startup

  @override
  void initState() {
    super.initState();
    _requestPermissions();
    _initTTS();
  }

  Future<void> _requestPermissions() async {
    await Permission.microphone.request();
  }

  Future<void> _initTTS() async {
    await flutterTts.setLanguage("en-US");
    await flutterTts.setPitch(1.0);
  }

  void translateText() {
    setState(() {
      isLoading = true;
      translatedText = ''; // Reset translated text on each call
    });

    // Assuming word-for-word translation using the words list
    List<String> inputWords = inputText.split(" ");
    List<String> outputWords = inputWords.map((word) {
      Word? matchedWord = words.firstWhere(
            (w) => _matchesInput(w, word.toLowerCase()),
        orElse: () => Word(english: "", tagalog: "", pangasinense: "", ilocano: ""),
      );
      return matchedWord.english.isNotEmpty
          ? _getTranslatedText(matchedWord)
          : word; // If not found, return the original word
    }).toList();

    setState(() {
      translatedText = outputWords.join(" ");
      isLoading = false;
    });
  }

  bool _matchesInput(Word word, String inputWord) {
    switch (selectedInputLang) {
      case 'Tagalog':
        return inputWord == word.tagalog.toLowerCase();
      case 'English':
        return inputWord == word.english.toLowerCase();
      case 'Pangasinan':
        return inputWord == word.pangasinense.toLowerCase();
      case 'Ilocano':
        return inputWord == word.ilocano.toLowerCase();
      default:
        return false;
    }
  }

  String _getTranslatedText(Word word) {
    switch (selectedOutputLang) {
      case 'Tagalog':
        return word.tagalog;
      case 'English':
        return word.english;
      case 'Pangasinan':
        return word.pangasinense;
      case 'Ilocano':
        return word.ilocano;
      default:
        return '';
    }
  }

  Future<void> _speak() async {
    if (translatedText.isNotEmpty) {
      await flutterTts.setLanguage("en-US");
      await flutterTts.speak(translatedText);
    }
  }

  Widget _buildBlurredCircle(double size, Color color) {
    return Container(
      width: size,
      height: size,
      decoration: BoxDecoration(
        shape: BoxShape.circle,
        color: color,
        boxShadow: [
          BoxShadow(
            color: color,
            blurRadius: 100,
            spreadRadius: 40,
          ),
        ],
      ),
    );
  }

  void _toggleSidebar() {
    setState(() {
      _isSidebarVisible = !_isSidebarVisible;
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Granary Translate'),
        leading: IconButton(
          icon: Icon(
            _isSidebarVisible ? Icons.arrow_back : Icons.menu,
            color: Colors.white,
          ),
          onPressed: _toggleSidebar,
        ),
      ),
      body: Stack(
        children: [
          // Background gradient and blurred circles
          Container(
            decoration: BoxDecoration(
